import Layout from "../components/layout/layout";

function Dashboard() {
  const position = {
    container: "flex gap-3 w-full h-full",
    lwrapper: "w-1/4 h-full",
    rwrapper: "w-3/4 h-full",
  };
  const design = {
    lwrapper: "bg-gray-50 rounded-xl",
    rwrapper: "bg-gray-50 rounded-xl",
  };

  return (
    <Layout>
      <div className={`${position.container}`}>
        <div className={`${position.lwrapper} ${design.lwrapper}`}></div>
        <div className={`${position.rwrapper} ${design.rwrapper}`}></div>
      </div>
    </Layout>
  );
}

export default Dashboard;
